import styled from "styled-components";

const Error = () => {
  return <Wrapper>Something went wrong</Wrapper>;
};

export default Error;

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 100%;
  height: 100%;
  padding-top: 40px;
`;
